const title = `plugins (插件)`;
const content = "\"---\\ntitle: plugins (插件)\\nsidebar_position: 9\\n---\\n# plugins (插件)\\n\\n- **类型：** `CliPlugin[]`\\n- **默认值：** `[]`\\n\\n用于配置自定义的 Modern.js 框架插件。\\n\\n自定义插件的编写方式请参考 [如何编写插件](/guides/topic-detail/framework-plugin/implement)。\\n\\n## 注意事项\\n\\n该选项**用于配置框架插件**，如果你需要配置其他类型的插件，请选择对应的配置方式：\\n\\n- 配置 Modern.js Builder 插件，请使用 [builderPlugins](docs/configure/app/builder-plugins) 配置项。\\n- 配置 webpack 插件，请使用 [tools.webpack](/configure/app/tools/webpack) 或 [tools.webpackChain](/configure/app/tools/webpack-chain) 配置项。\\n- 配置 Babel 插件，请使用 [tools.babel](/configure/app/tools/babel) 配置项。\\n\\n## 插件类型\\n\\nModern.js 中内置了三种不同的框架插件：\\n\\n- `CLI 插件`，适用于本地开发、编译构建阶段，可以在命令行和编译阶段扩展各种能力。\\n- `Server 插件`，适用于服务端。\\n- `Runtime 插件`，适用于前端运行时。\\n\\n目前 Modern.js 开放了自定义 CLI 插件的能力，Server 插件和 Runtime 插件会在后续开放。\\n\\n## 插件执行顺序\\n\\n默认情况下，自定义插件会按照 `plugins` 数组的顺序依次执行，Modern.js 内置插件的执行时机早于自定义插件。\\n\\n当插件内部使用了控制顺序的相关字段，比如 `pre`、`post` 时，会基于声明的字段对执行顺序进行调整，详见 [插件之间的关系](/guides/topic-detail/framework-plugin/relationship)。\\n\\n## 示例\\n\\n下面是 CLI 插件的使用示例。\\n\\n### 使用 npm 上的插件\\n\\n使用 npm 上的插件，需要通过包管理器安装插件，并通过 import 引入。\\n\\n```ts title=\\\"modern.config.ts\\\"\\nimport myPlugin from 'my-plugin';\\n\\nexport default defineConfig({\\n  plugins: [myPlugin()],\\n});\\n```\\n\\n### 使用本地插件\\n\\n使用本地代码仓库中的插件，直接通过相对路径 import 引入即可。\\n\\n```ts title=\\\"modern.config.ts\\\"\\nimport myPlugin from './config/plugin/myPlugin';\\n\\nexport default defineConfig({\\n  plugins: [myPlugin()],\\n});\\n```\\n\\n### 插件配置项\\n\\n如果插件提供了一些自定义的配置项，可以通过插件函数的参数传入配置。\\n\\n```ts title=\\\"modern.config.ts\\\"\\nimport myPlugin from 'my-plugin';\\n\\nexport default defineConfig({\\n  plugins: [\\n    myPlugin({\\n      foo: 1,\\n      bar: 2,\\n    }),\\n  ],\\n});\\n```\\n\"";
